const CalendarUI = ({ jobs }) => {
    return (
        <>
            {jobs.map((job) => {
                ;<>
                    <h3>{job.title}</h3>
                    <p>{job.company}</p>
                    <p>{job.description}</p>
                    <p>{job.category}</p>
                    <p>{job.payment}</p>
                    <p>{job.location}</p>
                </>
            })}
        </>
    )
}

export default CalendarUI
